    J[2805] += dqdci;             /* dwdot[OC12H23OOH]/d[OC12H23OOH] */
    /* d()/dT */
    J[2865] += dqdT;              /* dwdot[OH]/dT */
    J[2912] -= dqdT;              /* dwdot[O2C12H24OOH]/dT */
    J[2913] += dqdT;              /* dwdot[OC12H23OOH]/dT */

    /*reaction 268: OC12H23OOH => 3 C2H4 + C2H5 + 2 CH2CHO + OH */
    /*a non-third-body and non-pressure-fall-off reaction */
    /* forward */
    phi_f = sc[51];
    k_f = prefactor_units[267] * fwd_A[267]
                * exp(fwd_beta[267] * tc[0] - activation_units[267] * fwd_Ea[267] * invT);
    dlnkfdT = fwd_beta[267] * invT + activation_units[267] * fwd_Ea[267] * invT2;
    /* rate of progress */
    q = k_f*phi_f;
    dqdT = dlnkfdT*k_f*phi_f;
    /* update wdot */
    wdot[3] += q; /* OH */
    wdot[20] += 3 * q; /* C2H4 */
    wdot[21] += q; /* C2H5 */
    wdot[23] += 2 * q; /* CH2CHO */
    wdot[51] -= q; /* OC12H23OOH */
    /* d()/d[OC12H23OOH] */
    dqdci =  + k_f;
    J[2757] += dqdci;             /* dwdot[OH]/d[OC12H23OOH] */
    J[2774] += 3 * dqdci;         /* dwdot[C2H4]/d[OC12H23OOH] */
    J[2775] += dqdci;             /* dwdot[C2H5]/d[OC12H23OOH] */
    J[2777] += 2 * dqdci;         /* dwdot[CH2CHO]/d[OC12H23OOH] */
    J[2805] -= dqdci;             /* dwdot[OC12H23OOH]/d[OC12H23OOH] */
    /* d()/dT */
    J[2865] += dqdT;              /* dwdot[OH]/dT */
    J[2882] += 3 * dqdT;          /* dwdot[C2H4]/dT */
    J[2883] += dqdT;              /* dwdot[C2H5]/dT */
    J[2885] += 2 * dqdT;          /* dwdot[CH2CHO]/dT */
    J[2913] -= dqdT;              /* dwdot[OC12H23OOH]/dT */

    double c_R[53], dcRdT[53], e_RT[53];
    double * eh_RT;
    if (consP) {
        cp_R(c_R, tc);
        dcvpRdT(dcRdT, tc);
        eh_RT = &h_RT[0];
    }
    else {
        cv_R(c_R, tc);
        dcvpRdT(dcRdT, tc);
        speciesInternalEnergy(e_RT, tc);
        eh_RT = &e_RT[0];
    }

    double cmix = 0.0, ehmix = 0.0, dcmixdT=0.0, dehmixdT=0.0;
    for (int k = 0; k < 53; ++k) {
        cmix += c_R[k]*sc[k];
        dcmixdT += dcRdT[k]*sc[k];
        ehmix += eh_RT[k]*wdot[k];
        dehmixdT += invT*(c_R[k]-eh_RT[k])*wdot[k] + eh_RT[k]*J[2862+k];
    }

    double cmixinv = 1.0/cmix;
    double tmp1 = ehmix*cmixinv;
    double tmp3 = cmixinv*T;
    double tmp2 = tmp1*tmp3;
    double dehmixdc;
    /* dTdot/d[X] */
    for (int k = 0; k < 53; ++k) {
        dehmixdc = 0.0;
        for (int m = 0; m < 53; ++m) {
            dehmixdc += eh_RT[m]*J[k*54+m];
        }
        J[k*54+53] = tmp2*c_R[k] - tmp3*dehmixdc;
    }
    /* dTdot/dT */
    J[2915] = -tmp1 + tmp2*dcmixdT - tmp3*dehmixdT;
